import { DropdownButton } from 'react-bootstrap';
import Dropdown from 'react-bootstrap/Dropdown';
import { avalibleNumber } from '../types/avalibleNumberType';
import { useState } from 'react';
import { User } from '../types/userType';

interface CustomDropdownProps {
  items?: avalibleNumber[];

  selectedValue?: number;
}


function CustomDropdown({ items, selectedValue }: CustomDropdownProps) {
  const [selected, setSelected] = useState<number | undefined>(selectedValue);

  function handleSelect(value: number){
    setSelected(value);
  }

  if (!items || items.length === 0) {
    return <p>No items available</p>;
  }

  return (
    [<DropdownButton id="dropdown-basic-button" title={selected != undefined? `${selected}` : "Seleccionar"}>
      {items.map((item, index) => (
        <Dropdown.Item key={index} onClick={() => handleSelect(item.idAvalibleNumber)} >{item.idAvalibleNumber}</Dropdown.Item>
      ))}
    </DropdownButton>]
  );
}

export default CustomDropdown;
